create table company
(
    id       serial not null
        constraint company_pkey
            primary key,
    name     varchar(300),
    image    bytea,
    city     varchar(300),
    category varchar(300),
    cpf_cnpj varchar(300),
    phone    varchar(300),
    owner    varchar(300),
    address  varchar(300),
    lat      varchar(300),
    lon      varchar(300),
    password varchar(300),
    rating   varchar(300),
    hour     varchar(300),
    week     varchar(300)
);

alter table company
    owner to rgyxqnrswarutq;

